void Mid_Lcd_Init(void)
{

	Drv_RGBLcd_Init();
	MidLcdParam.InitFlg = true;
	MidLcdParam.BLGrade = eLcdBLGrade_5;
	
	Drv_RGBLcd_Sleep();
	
//	SMDrv_PWM_Open(LCDEC_CTIMER_PWM_MODULE,1);
//	SMDrv_CTimer_Start(LCDEC_CTIMER_PWM_MODULE);
}

// 背光占空比设置
void Mid_Lcd_BLDutySet(uint8_t Duty)
{
	if(Duty)
	{
		SMDrv_PWM_Stop(BL_CTIMER_PWM_MODULE);	
		SMDrv_PWM_Open(BL_CTIMER_PWM_MODULE,Duty);
		SMDrv_PWM_Start(BL_CTIMER_PWM_MODULE);	
		MidLcdParam.BLRunFlg = true;
	}
	else
	{
		SMDrv_PWM_Stop(BL_CTIMER_PWM_MODULE);
		MidLcdParam.BLRunFlg = false;
		SMDrv_GPIO_Open(RGB_LCD_BCKLED_PIN, NULL, NULL);	// 关背光
		am_hal_gpio_output_clear(RGB_LCD_BCKLED_PIN);
	}
}


void Mid_Lcd_Show(void)
{
    uint8_t *mainram = UI_Display_Get_MainRam();
    
    Drv_RGBLcd_RefreshAll(mainram);
}

void Mid_Lcd_Sleep(void)
{
	Drv_RGBLcd_Sleep();
}

